window.bookSummaryJSON = "<p><b>The world ended the night I was born. Coincidence? </b><b><i>I think not.</i></b></p> <p>Stuck living in the catacombs underneath what used to be NYC, I've managed to stay hidden and alive and safe-<i>ish.</i></p> <p>But when my guardian fails to return from a supply run, I'm forced to contemplate life on the surface.</p> <p>Worse? Three warriors have infiltrated my home, insisting that I am the last gold dragon they've been searching for. That everything I know everything I've believed is a lie.</p> <p>And more?</p> <p><b>They each think they're mated </b><b><i>to me.</i></b></p> <p><i>**Bury Me is a spicy standalone paranormal romance in the Immortal Vices and Virtues universe. You can expect 'touch her and I'll unalive you' vibes and three sinfully hot, super growly mates who will do anything to keep her. Mature themes will be present. Listener discretion is advised.**</i></p>"; 
